package XMLparser;

public class TurtleData {
	
	private Integer turtleID;
	private String imageURL;
	private String penDown;
	private Integer xLoc;
	private Integer yLoc;
	
	
	public TurtleData(Integer turtleID, String imageURL, String penDown, Integer xLoc, Integer yLoc) {
		// TODO Auto-generated constructor stub
		this.turtleID = turtleID;
		this.imageURL = imageURL;
		this.penDown = penDown;
		this.xLoc = xLoc;
		this.yLoc = yLoc;
	
		
	}

}
